import React from "react";
import "./home.css";
import { TypeAnimation } from 'react-type-animation';

function Home() {
  const ExampleComponent = () => {
    return (
      <TypeAnimation
        sequence={[
          'Software x Business',
          2000, 
          'Software x Videography',
          2000,
          'Software x Marketing',
          2000,
          'Software x Hardware',
          2000
        ]}
        wrapper="span"
        speed={50}
        style={{ fontSize: '3vw', display: 'inline-block' }}
        repeat={Infinity}
      />
    );
  };

  return (
    <div className="coverContainer">
      <div className="navbar">
        <ul className="navContainer">
          <li>JC</li>
          <li>Home</li>
          <li><a href="#about-me-section">About Me</a></li>
          <li>Portfolio</li>
          <li>Resume</li>
          <button>
            <li>CONTACT ME</li>
          </button>
        </ul>
      </div>
      <div className="cover">
        <div className="nameContainer">
          <h1 className="name">
            <p className="hi">Hi. I'm justin.</p>
            <ExampleComponent></ExampleComponent>
          </h1>
        </div>
      </div>
    </div>
  );
}

export default Home;
